import './assets/header.css'
function Header() {
    return (
        <>
        <header>
            <nav class='display-nav'>
                <ul>
                    <li>Ma présentation</li>
                    <li>Mes projets réalisés</li>
                    <li>Me contacter</li>
                </ul>
            </nav>
        </header>
        </>
    );
  }
  
  export default Header;
